DROP TABLE IF EXISTS level;
CREATE TABLE IF NOT EXISTS level (
    `level` INT,
    `nama` VARCHAR(26) CHARACTER SET utf8
);

DROP TABLE IF EXISTS kode_prov;
CREATE TABLE IF NOT EXISTS kode_prov (
    `kode_prov` INT,
    `nama` VARCHAR(20) CHARACTER SET utf8
);

DROP TABLE IF EXISTS kode_satker;
CREATE TABLE IF NOT EXISTS kode_satker (
    `kode_satker` INT,
    `nama` VARCHAR(33) CHARACTER SET utf8,
    `kode_prov` INT
);

DROP TABLE IF EXISTS imkb_satker;
CREATE TABLE IF NOT EXISTS imkb_satker (
    `kode_satker` INT,
    `kode_prov` INT,
    `tahun` INT,
    `imkb` NUMERIC(17, 15),
    `perlindungan_aset` NUMERIC(18, 15),
    `sumber_daya` NUMERIC(18, 15),
    `pemulihan` NUMERIC(18, 15),
    `rencana_tanggap` NUMERIC(18, 15)
);

DROP TABLE IF EXISTS imkb_pegawai;
CREATE TABLE IF NOT EXISTS imkb_pegawai (
    `level` INT,
    `tahun` INT,
    `kode_prov` INT,
    `kode_satker` INT,
    `nama` VARCHAR(40) CHARACTER SET utf8,
    `imkb` NUMERIC(18, 16),
    `pengetahuan` NUMERIC(19, 16),
    `sumber_daya` NUMERIC(18, 15),
    `rencana_tanggap` NUMERIC(18, 15)
);

DROP TABLE IF EXISTS simkb_covid;
DROP TABLE IF EXISTS simkb_bencana;
DROP TABLE IF EXISTS simkb_kebakaran;

DROP TABLE IF EXISTS simkb;
CREATE TABLE IF NOT EXISTS simkb (
    `kode_prov` INT,
    `kode_kantor` INT,
    `tahun` INT,
    `sumber_daya_kebakaran` NUMERIC(18, 15),
    `rencana_tanggap_kebakaran` NUMERIC(18, 15),
    `pemulihan_kebakaran` NUMERIC(18, 15),
    `perlindungan_aset_kebakaran` NUMERIC(18, 15),
    `simkb_kebakaran` NUMERIC(17, 15),
    `rencana_tanggap_covid19` NUMERIC(18, 15),
    `pemulihan_covid19` NUMERIC(17, 14),
    `perlindungan_aset_covid19` NUMERIC(19, 16),
    `simkb_covid19` NUMERIC(18, 15),
    `sumber_daya_bencana_alam` NUMERIC(18, 15),
    `rencana_tanggap_bencana_alam` NUMERIC(18, 15),
    `pemulihan_bencana_alam` NUMERIC(18, 15),
    `perlindungan_aset_bencana_alam` NUMERIC(18, 15),
    `simkb_bencana` NUMERIC(17, 15)
);
